import axios from 'axios';

const Api = axios.create({
    baseURL: 'https://consultanttestagence.000webhostapp.com',
    // baseURL: process.env.MIX_APP_URL,
    headers: {
        accept: "application/json",
        "content-Type": "application/json",
        // "X-localization": "es"
    }
});

export default Api;
